  false,\n\t\"url\": null,\n\t\"notes\": \"This plan summarizes last years planned
  water management program and  actual CY 1983 water events. A more detailed summary
  is available in  the CY 1983 Annual Water Report. It was attempted in annual plans
  to make optimum use of water expected each year. Using past records of water receipts,
  water levels, vegetative production and wildlife use for each impoundment or area,
  a priority water use system has been developed for water utilization. Using this
  data in relation to past annual snow melt runoff predictions, actual water inflows,
  known evaporation losses, total impoundments to be maintained, etc. , water use
  is predicted and prioritized.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
